import React from 'react';
import { Card, Avatar } from 'antd';


const UserProfile = () => {
    return (
        <Card
            actions={[
                <div key="twit">짹짹</div>,
                <div key="followings"></div>,
                <div key="setting"></div>,
            ]}
        >
            <Card.Meta 
                avatar={<Avatar>ZC</Avatar>}
                title="ZeroCho"
            />
        </Card>
    )
}

export default UserProfile;
